import React from 'react';
import {withRouter } from 'react-router-dom';
import { connect } from 'react-redux';
import Header from '../Header/Header';
import axios from 'axios';
import './table.css';
import * as contactsAction from '../../actions/contactAction';

class MyContacts extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            isLoading: true,
            users:[],
            color:['red','yello']
        }
    }

    componentDidMount(){
        const loggingIn = localStorage.getItem('user-token');
        if(!loggingIn){
          this.props.history.push("/");
        }
        const {user_id} = 1;
        this.props.fetchContact();
        axios.post('http://localhost:7000/api/user/fetchContact')
        .then(response => {
            console.log('response data',response.data);
            this.setState({users:response});
          })
        .catch(function (error) {
            alert('Network Issue');
        })

    }


    render() {
        const {data} = this.props.contactList;
        const{isLoading}= this.state;
        console.log('data type is', typeof data);
        console.log('state data type is', typeof this.state.users);
        console.log('color data type is', typeof this.state.color);
        return (
            <>
            <Header />
                <div className="container">
        <pre>{JSON.stringify(data,null,2)}</pre>
                    <div className="table-wrapper">
                    <div className="table-title">
                        <div className="row">
